import React from 'react';
import Rainbow from '../hoc/Rainbow';

this.state = {
    gender: {
      male: 'male',
      female: 'female'
    }     
  }
const uyelik = (props) => {
	// console.log(props);
	// setTimeout(() => {
	// 	  props.history.push("/about");
	// 	}, 2000);

	return (
		<div>
                            <FormGroup controlId="gender">
            <ControlLabel>Gender</ControlLabel>
            <br />
            <Radio
                name="radioGroup"
                type="radio"
                inline
                value={this.state.gender === "male"}
            >
                onChange={this.handleChange}
                Male
            </Radio>
            <Radio
                name="radioGroup"
                type="radio"
                inline
                value={this.state.gender === "female"}
            >
                onChange={this.handleChange}
                Female
            </Radio>
            </FormGroup>

		</div>
	)
}


export default Rainbow(uyelik);
